import React from "react"
import { StyleSheet, Text, View, TextInput, Button } from "react-native"
import styles from "./StyleSheet"
const Login = () => {
    const [username, setUsername] = React.useState("")
    const [password, setPassword] = React.useState("")
    return (
    <View   style={styles.container}>
        <View   style={styles.input_container}>
        <TextInput style={styles.input} onChangeText ={setUsername} value={username} placeholder="username"></TextInput>
        <TextInput style={styles.input} onChangeText ={setPassword} value={password} placeholder="password"></TextInput>
        </View>
        <View style={styles.button_container}>
        <Button title="Login" onPress={() => alert("Login")}></Button>
        <Button title="Register" onPress={() => alert("Register")}></Button>
        </View>

    </View>
    )
}
export default Login
